function getMockBaseCommerceFacetResponse() {
    return {
        displayName: '',
        facetId: '',
        field: '',
        fromAutoSelect: false,
        isFieldExpanded: false,
        moreValuesAvailable: false,
        numberOfValues: 0,
    };
}
export function buildMockCommerceRegularFacetResponse(config = {}) {
    return {
        ...getMockBaseCommerceFacetResponse(),
        type: 'regular',
        values: [],
        ...config,
    };
}
